INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (1, 2, 'Redesigned Dashboard that allows you to have better control over Freeform and the built-in notices and warnings area gives your more peace of mind as it keeps you informed about issues and new features that may specifically affect this site.', '[]', 'new', true, '2020-11-04 14:00:00', '2020-11-10 15:34:22', '2020-11-13 02:43:00', '16bbd93c-921a-4e2e-b311-1939d011c758');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (2, 2, 'The ''Important Update Notices'' area in the Dashboard keeps you informed about issues that may specifically affect this site, while the ''What''s New'' area in the Dashboard lets you know about new features available in the current version you''ve just updated to.', '[]', 'new', true, '2020-11-04 14:00:00', '2020-11-10 15:34:22', '2020-11-13 02:43:00', 'd48668e2-fe95-4871-93f8-4e9935b908d6');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (3, 2, 'The ''Weekly Digest'' email notification will keep you in the loop about your website''s Freeform form performance and status. It includes a snapshot of the previous week''s performance and any logged errors and upgrade notices.', '[]', 'new', true, '2020-11-04 14:00:00', '2020-11-10 15:34:22', '2020-11-13 02:43:00', 'bd5031fc-d801-45cd-bd04-3fe8131d9c87');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (4, 2, 'You can now define general success and error messages for each form inside the form builder. Choose to set and define ''Loading...'' indicators on your submit buttons in forms as well.', '[]', 'new', true, '2020-11-04 14:00:00', '2020-11-10 15:34:22', '2020-11-13 02:43:00', 'b516c2bb-2fe7-4241-ac69-a12048b1780c');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (5, 2, 'A Freeform plugin badge is now available to show the error/notice count, spam submission count, submission count when enabled.', '[]', 'new', true, '2020-11-04 14:00:00', '2020-11-10 15:34:22', '2020-11-13 02:43:00', '025a214c-a6e0-420f-ae7f-e30de5ca403a');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (6, 10, 'Freeform 3.9.0 introduced some changes to the included sample Formatting Templates. These changes likely only affect a small number of sites. If any of your forms are 1) using the default example formatting templates, 2) not using AJAX, and 3) you are translating the main success and error banner messages, you may be affected. If all 3 of those conditions apply, please update your language string to be ''Sorry, there was an error submitting the form. Please try again.'' and place it inside the ''site.php'' translation file (instead of ''freeform.php''). If your site only has 1 language, you can also consider switching to use the new Validation tab approach where the messages can be set inside the form builder per form.', '[]', 'warning', true, '2020-12-02 14:00:00', '2020-12-02 18:30:39', '2021-02-09 00:34:07', '3b72d65a-e61d-43fb-955b-13e143ac0dfe');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (7, 11, 'Would you be willing to take a few minutes to complete a survey about your experience with Freeform? We value your feedback and you will also be entered into a draw to win a $100* Amazon gift card! It should only take a couple of minutes and you can remain anonymous if you like. Visit the following link to complete: https://solspace.typeform.com/to/KxJivfHE
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (8, 12, 'The Freeform 3.10 beta is now underway! New features include support for GraphQL, multi-page AJAX, improvements to the Freeform JS plugin, email notifications, and a wide variety of other improvements. Putting exciting but larger updates through rigorous public beta testing is now part of our commitment to providing an even more reliable experience with Freeform! If you''d like to be a part of the 3.10 beta, please visit the following page for instructions and more details: https://docs.solspace.com/craft/freeform/v3/setup/betas.html', '[]', 'info', true, '2020-12-16 14:03:00', '2020-12-16 22:31:54', '2021-02-09 00:34:07', 'f9ae8fe1-0e3f-4570-be6e-b19873c2a667');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (9, 14, 'Freeform 3.10 is now available! New features include support for GraphQL, multi-page AJAX, improvements to the Freeform JS plugin, the Weekly Digest, email notifications, and a wide variety of other improvements.', '[]', 'info', true, '2021-01-06 07:00:00', '2021-01-06 08:33:47', '2021-02-09 00:34:07', 'daf67dba-14e8-4ab7-b5c6-b6b0ae39cf49');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (10, 19, 'The Freeform 3.11 beta is now underway! New features include support for editing other Craft elements, creation of Calendar Events, ability to update file-based email notification templates directly inside the CP, a full-screen HTML & Rich Text editor inside the form builder, and refining other areas of Freeform to be more robust. If you''d like to be a part of the 3.11 beta, please visit the following page for instructions and more details: https://docs.solspace.com/craft/freeform/v3/setup/betas.html', '[]', 'info', true, '2021-02-25 14:03:00', '2021-03-24 23:43:20', '2021-04-07 14:19:36', '0bad7cba-281f-4021-bedc-64078d4c5098');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (11, 23, 'Freeform 3.11 is now available! New features include the ability to edit other Craft Elements and map to Calendar Events with the Element Connections feature, full-screen HTML & Twig and Rich Text editor inside the form builder, ability to update file-based email notification templates directly inside the CP, support for searching by submissions'' field values in the CP Submissions index, more granular submission viewing and management permissions, ability to lazy load reCAPTCHA scripts, various improvements to the Freeform JS plugin, and a wide variety of other improvements!', '[]', 'info', true, '2021-04-20 06:00:00', '2021-04-20 23:15:55', '2021-04-28 13:18:27', '86b5b5d4-22e1-4d67-8b49-80e9770823e5');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (13, 25, 'Added the ability to edit other Craft Elements, including special support for Craft Users (Pro).', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', '5f801619-1461-485d-bfd3-a916ffde4ad6');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (14, 25, 'Added the ability to map to Calendar Events with the Element Connections feature (Pro).', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', 'b5692cb1-c311-4226-8a71-3eb115345898');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (15, 25, 'Added a full-screen HTML & Twig and Rich Text editor inside the form builder.', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', 'ef869787-7042-4b79-811f-e58df1361302');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (16, 25, 'Added the ability to update file-based email notification templates directly inside the CP (optional). Included a migration tool for migrating from Database to File-based email notifications.', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', 'c8998818-8048-4fa6-b2ed-ee22840a9e00');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (17, 25, 'Added support for searching by submissions'' field values in the CP Submissions index.', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', '435ac784-2c4c-42b4-94f3-d5018fbe780a');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (18, 25, 'Added more granular submission viewing and management permissions. You can now set read-only permissions in addition to management permissions.', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', '704bc1d2-a026-4d25-b193-288a66e8a8d4');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (19, 25, 'Added a setting that allows you to optionally restrict the Forms element field type to only show forms which the user has manage permissions for.', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', '09ef097e-871d-4f2a-824c-5fa23b8a0c7c');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (20, 25, 'Added ability to load reCAPTCHA scripts (and checkbox field if using v2 Checkbox) only once the site visitor interacts with the form.', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', 'd6641258-3e0a-496a-a323-8d72d198cfe2');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (21, 25, 'Added export profile developer events, allowing the addition of custom exporters.', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', 'e249c793-5966-4228-9873-64c2d828203a');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (12, 24, 'Freeform 3.11+ introduced changes to how its front-end scripts are inserted into pages (as static URLs). If you have server rules applied to JS and CSS files, you may run into issues. If this is the case, please upgrade to Freeform 3.11.2 immediately, and then switch the behavior back to previous approaches (''As Files'' introduced in 3.10 or ''Inline'' as it worked previously before 3.10+). This is a new ''Freeform Script Insert Type'' setting available in the General Settings of Freeform 3.11.2 or with Project Config as `scriptInsertType: files`.', '[]', 'warning', true, '2021-04-28 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:32', 'fe80ee2a-f6db-456c-bb18-06c604c67a40');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (22, 25, 'Various improvements to Freeform''s JS, including optimization to no longer include excess polyfills, no longer fetching field-specific scripts if the fields aren''t present in the form, loading the JS as a separate ''freeform/plugin.js'' file path, and ''freeform.loadFreeformPlugin()'' to load the JS manually in your template.', '[]', 'new', true, '2021-04-20 13:00:00', '2021-04-29 22:25:35', '2021-05-04 12:32:33', '3b2725a8-ca34-4bc7-8a55-41937b428e92');
INSERT INTO public.freeform_feed_messages (id, "feedId", message, conditions, type, seen, "issueDate", "dateCreated", "dateUpdated", uid) VALUES (23, 32, 'Would you be willing to take a few minutes to complete a survey about your experience with Freeform? We value your feedback and you will also be entered into a draw to win a $100* Amazon gift card! It should only take a couple of minutes and you can remain anonymous if you like. Visit the following link to complete: https://solspace.typeform.com/to/ajYYOwK2
