'': #{displayFeatures.value ? ''true'' : ''false''}\"\n    ~ \"}\"\n-%}\ngtag(''config'', ''{{ googleAnalyticsId.value }}'', {{ gtagConfig }});\n{% endif %}\n{% if googleAdWordsId.value %}\n{%- set gtagConfig = \"{\"\n    ~ \"''send_page_view'': #{pageView ? ''true'' : ''false''}\"\n    ~ \"}\"\n-%}\ngtag(''config'', ''{{ googleAdWordsId.value }}'', {{ gtagConfig }});\n{% endif %}\n{% if dcFloodlightId.value %}\n{%- set gtagConfig = \"{\"\n    ~ \"''send_page_view'': #{pageView ? ''true'' : ''false''}\"\n    ~ \"}\"\n-%}\ngtag(''config'', ''{{ dcFloodlightId.value }}'', {{ gtagConfig }});\n{% endif %}\n{% endif %}\n","position":1,"bodyTemplatePath":"_frontend/scripts/gtagBody.twig","bodyTemplateString":"{% set gtagProperty = googleAnalyticsId.value ?? googleAdWordsId.value ?? dcFloodlightId.value ?? null %}\n{% if gtagProperty %}\n<script async src=\"{{ gtagScriptUrl.value }}?id={{ gtagProperty }}\"></script>\n{% endif %}\n","bodyPosition":2,"vars":{"googleAnalyticsId":{"title":"Google Analytics Tracking ID","instructions":"Only enter the ID, e.g.: `UA-XXXXXX-XX`, not the entire script code. [Learn More](https://support.google.com/analytics/answer/1032385?hl=e)","type":"string","value":""},"googleAdWordsId":{"title":"AdWords Conversion ID","instructions":"Only enter the ID, e.g.: `AW-XXXXXXXX`, not the entire script code. [Learn More](https://developers.google.com/adwords-remarketing-tag/)","type":"string","value":""},"dcFloodlightId":{"title":"DoubleClick Floodlight ID","instructions":"Only enter the ID, e.g.: `DC-XXXXXXXX`, not the entire script code. [Learn More](https://support.google.com/dcm/partner/answer/7568534)","type":"string","value":""},"sendPageView":{"title":"Automatically send PageView","instructions":"Controls whether the `gtag.js` script automatically sends a PageView to Google Analytics, AdWords, and DoubleClick Floodlight when your pages are loaded.","type":"bool","value":true},"ipAnonymization":{"title":"Google Analytics IP Anonymization","instru