pot Script URL","instructions":"The URL to the HubSpot script. Normally this should not be changed, unless you locally cache it.","type":"string","value":"//js.hs-scripts.com/"}},"dataLayer":[],"include":false,"key":"hubSpot","environment":{"staging":{"include":false},"local":{"include":false}},"dependencies":null,"tagAttrs":[],"nonce":null},"fathom":{"name":"Fathom","description":"Fathom is a simple, light-weight, privacy-first alternative to Google Analytics. So, stop scrolling through pages of reports and collecting gobs of personal data about your visitors, both of which you probably dont need. [Learn More](https://usefathom.com/)","templatePath":"_frontend/scripts/fathomAnalytics.twig","templateString":"{% if siteId.value is defined and siteId.value %}\n(function() {\nvar tag = document.createElement(''script'');\ntag.src = \"{{ scriptUrl.value }}\";\ntag.defer = true;\ntag.setAttribute(\"data-site\", \"{{ siteId.value | raw }}\");\n{% if honorDnt.value %}\ntag.setAttribute(\"data-honor-dnt\", \"true\");\n{% endif %}\n{% if disableAutoTracking.value %}\ntag.setAttribute(\"data-auto\", \"false\");\n{% endif %}\n{% if ignoreCanonicals.value %}\ntag.setAttribute(\"data-canonical\", \"false\");\n{% endif %}\n{% if excludedDomains.value | length %}\ntag.setAttribute(\"data-excluded-domains\", \"{{ excludedDomains.value | raw }}\");\n{% endif %}\n{% if includedDomains.value | length %}\ntag.setAttribute(\"data-included-domains\", \"{{ includedDomains.value | raw }}\");\n{% endif %}\nvar firstScriptTag = document.getElementsByTagName(''script'')[0];\nfirstScriptTag.parentNode.insertBefore(tag, firstScriptTag);\n})();\n{% endif %}\n","position":1,"bodyTemplatePath":null,"bodyTemplateString":null,"bodyPosition":2,"vars":{"siteId":{"title":"Site ID","instructions":"Only enter the Site ID, not the entire script code. [Learn More](https://usefathom.com/support/tracking)","type":"string","value":""},"honorDnt":{"title":"Honoring Do Not Track (DNT)","instructions":"By defaul