 code. [Learn More](https://support.google.com/analytics/answer/1032385?hl=e)","type":"string","value":""},"googleAdWordsId":{"title":"AdWords Conversion ID","instructions":"Only enter the ID, e.g.: `AW-XXXXXXXX`, not the entire script code. [Learn More](https://developers.google.com/adwords-remarketing-tag/)","type":"string","value":""},"dcFloodlightId":{"title":"DoubleClick Floodlight ID","instructions":"Only enter the ID, e.g.: `DC-XXXXXXXX`, not the entire script code. [Learn More](https://support.google.com/dcm/partner/answer/7568534)","type":"string","value":""},"sendPageView":{"title":"Automatically send PageView","instructions":"Controls whether the `gtag.js` script automatically sends a PageView to Google Analytics, AdWords, and DoubleClick Floodlight when your pages are loaded.","type":"bool","value":true},"ipAnonymization":{"title":"Google Analytics IP Anonymization","instructions":"In some cases, you might need to anonymize the IP addresses of hits sent to Google Analytics. [Learn More](https://developers.google.com/analytics/devguides/collection/gtagjs/ip-anonymization)","type":"bool","value":false},"displayFeatures":{"title":"Google Analytics Display Features","instructions":"The display features plugin for gtag.js can be used to enable Advertising Features in Google Analytics, such as Remarketing, Demographics and Interest Reporting, and more. [Learn More](https://developers.google.com/analytics/devguides/collection/gtagjs/display-features)","type":"bool","value":false},"enhancedLinkAttribution":{"title":"Google Analytics Enhanced Link Attribution","instructions":"Enhanced link attribution improves click track reporting by automatically differentiating between multiple link clicks that have the same URL on a given page. [Learn More](https://developers.google.com/analytics/devguides/collection/gtagjs/enhanced-link-attribution)","type":"bool","value":false},"gtagScriptUrl":{"title":"Google gtag.js Script URL","instructions":"The URL to the Google gtag.j