 tag that powers conversion tracking, retargeting, and web analytics for LinkedIn ad campaigns.","templatePath":"_frontend/scripts/linkedInInsightHead.twig","templateString":"{% if dataPartnerId.value is defined and dataPartnerId.value %}\n_linkedin_data_partner_id = \"{{ dataPartnerId.value }}\";\n{% endif %}\n","position":1,"bodyTemplatePath":"_frontend/scripts/linkedInInsightBody.twig","bodyTemplateString":"{% if dataPartnerId.value is defined and dataPartnerId.value %}\n<script type=\"text/javascript\">\n(function(){var s = document.getElementsByTagName(\"script\")[0];\n    var b = document.createElement(\"script\");\n    b.type = \"text/javascript\";b.async = true;\n    b.src = \"{{ linkedInInsightUrl.value }}\";\n    s.parentNode.insertBefore(b, s);})();\n</script>\n<noscript>\n<img height=\"1\" width=\"1\" style=\"display:none;\" alt=\"\" src=\"{{ linkedInInsightNoScriptUrl.value }}?pid={{ dataPartnerId.value }}&fmt=gif\" />\n</noscript>\n{% endif %}\n","bodyPosition":3,"vars":{"dataPartnerId":{"title":"LinkedIn Data Partner ID","instructions":"Only enter the ID, e.g.: `XXXXXXXXXX`, not the entire script code. [Learn More](https://www.linkedin.com/help/lms/answer/65513/adding-the-linkedin-insight-tag-to-your-website?lang=en)","type":"string","value":""},"linkedInInsightUrl":{"title":"LinkedIn Insight Script URL","instructions":"The URL to the LinkedIn Insight script. Normally this should not be changed, unless you locally cache it.","type":"string","value":"https://snap.licdn.com/li.lms-analytics/insight.min.js"},"linkedInInsightNoScriptUrl":{"title":"LinkedIn Insight &lt;noscript&gt; URL","instructions":"The URL to the LinkedIn Insight `&lt;noscript&gt;`. Normally this should not be changed, unless you locally cache it.","type":"string","value":"https://dc.ads.linkedin.com/collect/"}},"dataLayer":[],"include":false,"key":"linkedInInsight","environment":{"staging":{"include":false},"local":{"include":false}},"dependencies":null,"tagAttrs":[],"nonce":null},"hu