async=!0,t.src=e;var\nr=document.getElementsByTagName(\"script\")[0];r.parentNode.insertBefore(t,r)}}(\"{{ pinterestTagUrl.value }}\");\npintrk(''load'', ''{{ pinterestTagId.value }}'');\n{% set pageView = (sendPageView.value and not seomatic.helper.isPreview) %}\n{% if pageView %}\npintrk(''page'');\n{% endif %}\n{% endif %}\n","position":1,"bodyTemplatePath":"_frontend/scripts/pinterestTagBody.twig","bodyTemplateString":"{% if pinterestTagId.value is defined and pinterestTagId.value %}\n<noscript><img height=\"1\" width=\"1\" style=\"display:none;\" alt=\"\" src=\"{{ pinterestTagNoScriptUrl.value }}?tid={{ pinterestTagId.value }}&noscript=1\" /></noscript>\n{% endif %}\n","bodyPosition":2,"vars":{"pinterestTagId":{"title":"Pinterest Tag ID","instructions":"Only enter the ID, e.g.: `XXXXXXXXXX`, not the entire script code. [Learn More](https://developers.pinterest.com/docs/ad-tools/conversion-tag/)","type":"string","value":""},"sendPageView":{"title":"Automatically send Pinterest Tag PageView","instructions":"Controls whether the Pinterest Tag script automatically sends a PageView to when your pages are loaded.","type":"bool","value":true},"pinterestTagUrl":{"title":"Pinterest Tag Script URL","instructions":"The URL to the Pinterest Tag script. Normally this should not be changed, unless you locally cache it.","type":"string","value":"https://s.pinimg.com/ct/core.js"},"pinterestTagNoScriptUrl":{"title":"Pinterest Tag Script &lt;noscript&gt; URL","instructions":"The URL to the Pinterest Tag `&lt;noscript&gt;`. Normally this should not be changed, unless you locally cache it.","type":"string","value":"https://ct.pinterest.com/v3/"}},"dataLayer":[],"include":false,"key":"pinterestTag","environment":{"staging":{"include":false},"local":{"include":false}},"dependencies":null,"tagAttrs":[],"nonce":null},"fathom":{"name":"Fathom","description":"Fathom is a simple, light-weight, privacy-first alternative to Google Analytics. So, stop scrolling through pages of reports and 